    "human": "\nHey guys! Dovile here! I’m so sad to leave the best team on the earth\nbut I’m so happy I can stay on the website forever! Whoever ever reads\nthis, smile - because you work with the greatest bunch of people,\nlearn - because everyone here is happy to share their knowledge and\nhelp you, enjoy your work - because everything you do helps thousands\nof people across the globe. I am leaving a piece of my heart here and\nwill forever be a community manager at HU! <3\n\n--\n\nHi, @thattommyhall here. Only spent a month with the team but they are\nawesome - lovely peeps doing things right and making a difference.\nCome work here and see for yourself :-)\n\nMuch love,\nTommy\n\n--\n\nTwo years trying to teach these guys about comms, risk and reputation management ... I'll leave it up \nto those reading this to judge how well i did this. HealthUnlocked is something a little bit special, \nI leave today incredibly sad to be going, proud of what has been achieved over the past few years and \nexcited about its future.\n\nAlexa\n\n(oh and please keep Russell away from the twitter account and if i ever see an axe on a HealthUnlocked \nfacebook post i will be back to find the person responsible!)\n\n--\n\nI will miss everyone at HU. You guys score very high on the humility-to-talent metric (I came up\nwith). In other words, you absolutely rock! I had a very good time here, even remember crying a\ncouple of times… from laughter, obvs.\n\nThere are few companies that can see the positive impact they're having on the world, but HU is one\nof them and I was lucky enough to spend my last 2 years here. I've never been exposed to so many\nstories of human suffering, perseverance and achievement. This is what makes us human at the end of\nthe day :-).\n\nI don't know any poems, but I'll leave you with a quote from Stephen Hawking I found online that I\nthink is mildly relevant:\n\n\"For millions of years, mankind lived just like the animals. Then something happened which unleashed\nthe power of our imagination. We learned to talk and we learned to listen. Speech has allowed the\ncommunication of ideas, enabling human beings to work together to build the impossible. Mankind's\ngreatest achievements have come about by talking, and its greatest failures by not talking. It\ndoesn't have to be like this. Our greatest hopes could become reality in the future. With the\ntechnology at our disposal, the possibilities are unbounded. All we need to do is make sure we keep\ntalking.\"\n\nSee you around, \nMaria <3\n\n--\n\nI am lucky to have been a part of the HealthUnlocked family. What a bunch of talented, hardworking and \ninspiring people! Everyone is so friendly and supportive. Working with you was also really fun, even \nremotely! I truly enjoyed every day with you. I will be missing our park lunches, afterwork beers and \nour Slack workspace with giphies a lot. You all are amazing! I have found a lot of friends here and I \nam really sad to be leaving. I wish the team and each and everyone a deserved huge success and I hope \nto see you in the very near future!\n\nUli\n\n--\n\nI feel lucky to have been part of this amazing team for over 3 years and it was a chance for me to be working with a bunch of nice and talented people.\nWe've accomplished so much already but I truly believe that you will do much more in the future.\nI'm sad to be leaving but I'm also very grateful for my experience here and I've learned a lot from you all.\nI wish you guys all the best!\n\nRaymond\n\n--\n\nHi my name is Alex, and I'm joining not leaving!\nI've edited this file so that I can make a deployment with a change, to verify that my environment is working correctly.\nThanks!\n"
